.issue {
    width: 1276px; height: 90px;
    margin-bottom: 50px;
    margin: 0 auto;
}
.issue a {
    position: relative;
    width: 309px; height: 90px;
    border: 1px solid black;
    display: inline-block;
    font-size: 25px;
    line-height: 90px;
    border-radius: 5px;
}
.issue a:after {
    position: absolute;
    content: "";
    width: 100%;
    height: 0;
    bottom: 0;
    left: 0;
    z-index: -1;
    background: black;
    transition: all 0.2s ease
}
.issue a:hover {
    color: white;
}
.issue a:hover:after {
    top: 0;
    height: 100%;
}

