    line-height: 30px;
    font-size: 18px;
    border-radius: 3px;
    cursor: pointer;
    transition: all .5s;
}
.life_open:hover {
    background-color: black;
    color: white;
    width: 90px;
}
.life_close:hover {
    background-color: black;
    color: white;
    width: 90px;
